 import './App.css';
 import styled from 'styled-components';

 /*stylesheet*/
 const Blog = styled.div `
display: flex;
justify-content: center;
align-items: center;
flex-direction: column;
padding:40px;
border-bottom:1px sold rgba(0,0,0,0.05);
`;

 const Heading = styled.div`
 display: flex;
  justify-content: center;
  align-items: center;
  flex-direction: column;
`;


 function App() {

   return ( 
     <Blog >
     <Heading >
     <span > My Recent Posts < /span> 
     <h3 > My Blog < /h3> 
     </Heading > <
     /Blog>
   );
 }

 export default App;
